// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Welcome from '/pages/Welcome';
import Index from '/pages/Index'; // Ensure you have created this page
import Problem from '/pages/Problem'; // Ensure you have created this page
import Result from '/pages/Result'; // Ensure you have created this page

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Welcome />} />
        <Route path="/index" element={<Index />} />
        <Route path="/problem" element={<Problem />} />
        <Route path="/result" element={<Result />} />
      </Routes>
    </Router>
  );
}

export default App;
